import React, {Component} from 'react';
import {connect} from 'react-redux';
import {login} from '../../actions/loginActions';

class Login extends Component {
	render() {
		return(
      <div>
        <div className="header">
          <img className="logo" alt="logo" src="data:image/png;base64,"/>
          <h6 className="header-text">EMPLOYEE PORTAL</h6>
        </div>
        <div className="container">
          <div className="login-form">
            <form action="" role="form">
              <h4 className="login-form-title text-center">EMPLOYEE PORTAL LOGIN</h4>
              <div className="form-group">
                <div className="input-group">
                  <input type="text" className="form-control" placeholder="Employee Badge #" />
                </div>
              </div>
              <div className="form-group">
                <div className="input-group">
                  <input type="password" className="form-control" placeholder="Password" />
                </div>
                <span className="forgot-password">FORGOT PASSWORD</span>
              </div>
              <div className="form-group login-group-buttons">
                <button type="submit" className="btn btn-lg col-xs-12 login-button">LOGIN</button>
                <button className="btn btn-lg register-btn col-xs-12 register-button">REGISTER</button>
              </div>
            </form>
          </div>
        </div>
      </div>
		);
	}
}

const mapStateToProps = () => {
  return {
    // isLoginPending: state.login.isLoginPending,
    // isLoginError: state.login.isLoginError,
    // isLoginSuccess: state.login.isLoginSuccess
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    login: (email, password, props) => dispatch(login(email, password, props)),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Login);